import React from 'react';

// Helper components for FounderSection
function InterestCard({ icon, title, description }) {
  return (
    <div className="interest-card">
      <i className={`fas ${icon}`}></i>
      <div className="interest-content">
        <h4>{title}</h4>
        <p>{description}</p>
      </div>
    </div>
  );
}

function ImageCard({ src, alt, label }) {
  return (
    <div className="image-card">
      <img src={src} alt={alt} />
      <div className="image-label">{label}</div>
    </div>
  );
}

/**
 * Founder section component
 */
function FounderSection() {
  const interests = [
    {
      icon: "fa-mountain",
      title: "Hiking Adventures",
      description: "Exploring trails across the globe"
    },
    {
      icon: "fa-music",
      title: "Music Festivals",
      description: "Celebrating life through rhythm"
    },
    {
      icon: "fa-om",
      title: "Yoga Practice",
      description: "Mind-body connection"
    },
    {
      icon: "fa-yin-yang",
      title: "Tai Chi",
      description: "Moving meditation"
    },
    {
      icon: "fa-people-group",
      title: "Group Sporting Events",
      description: "Building community through play"
    },
    {
      icon: "fa-bitcoin",
      title: "Early Bitcoin Investor",
      description: "$$ Long-term vision $$"
    }
  ];

  const images = [
    { src: "/api/placeholder/400/533", alt: "Mountain Trails", label: "Mountain Trails" },
    { src: "/api/placeholder/400/533", alt: "Mindful Movement", label: "Mindful Movement" },
    { src: "/api/placeholder/400/533", alt: "Festival Vibes", label: "Festival Vibes" },
    { src: "/api/placeholder/400/533", alt: "Community Sports", label: "Community Sports" }
  ];

  return (
    <section className="founder-section" id="founder">
      <div className="founder-content">
        <div className="founder-header">
          <h2>Our Story</h2>
          <p>Building a community where adventure meets authenticity, and where every journey contributes to collective growth.</p>
        </div>

        <div className="founder-grid">
          <div className="founder-story">
            <p>Dancing Dragons began with a simple insight: women often have their richest adventures and forge their strongest friendships in spaces focused purely on connection and growth.</p>

            <div className="interests-section">
              <h3>Passions & Pursuits</h3>
              <div className="interests-grid">
                {interests.map((interest, index) => (
                  <InterestCard key={index} {...interest} />
                ))}
              </div>
            </div>

            <p>As the founder, my journey started early. An avid sports enthusiast and adventure seeker, I found myself drawn to communities that celebrated authentic connection. My own path has been shaped by early investments in bitcoin (which I promised myself not to touch until 30), allowing me to focus on creating something meaningful.</p>

            <div className="vision-section">
              <h3>Community Vision</h3>
              <p>Today, while I provide the resources that make Dancing Dragons possible, the community is led and shaped entirely by its women members. This structure allows for authentic connections and leadership to emerge naturally.</p>
            </div>

            <div className="early-connect">
              <h3>
                <i className="fas fa-sparkles"></i>
                Join the Adventure Early
              </h3>
              <p>While our major community features launch in 2030, we're already connecting with passionate adventurers who share our vision. If you're excited about being part of something special from the beginning, reach out now through Signal. Early connections help shape our community's future.</p>
            </div>
          </div>

          <div className="image-grid">
            <div className="col">
              <ImageCard {...images[0]} />
              <ImageCard {...images[1]} />
            </div>
            <div className="col">
              <ImageCard {...images[2]} />
              <ImageCard {...images[3]} />
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}

export default FounderSection;
